function pointInPolygon(point, vs) {
    var x = point[0], y = point[1];
    var inside = false;
    for (var i = 0, j = vs.length - 1; i < vs.length; j = i++) {
        var xi = vs[i][0], yi = vs[i][1];
        var xj = vs[j][0], yj = vs[j][1];
        var intersect = ((yi > y) != (yj > y)) &&
                        (x < (xj - xi) * (y - yi) / (yj - yi + 0.0) + xi);
        if (intersect) inside = !inside;
    }
    return inside;
}

function findCell(lat, lon) {
    for (var k = 0; k < gridData.features.length; k++) {
        var f = gridData.features[k];
        var geom = f.geometry;
        if (geom.type === "Polygon") {
            var ring = geom.coordinates[0];
            if (pointInPolygon([lon, lat], ring)) {
                return f.properties;
            }
        }
    }
    return null;
}

var clickMarker = null;

map_1f9547e6ca0a7e34c5458588a0cd8e2f.on('click', function(e) {
    var lat = e.latlng.lat;
    var lon = e.latlng.lng;

    var props = findCell(lat, lon);

    if (clickMarker) {
        map_1f9547e6ca0a7e34c5458588a0cd8e2f.removeLayer(clickMarker);
    }

    clickMarker = L.marker([lat, lon]).addTo(map_1f9547e6ca0a7e34c5458588a0cd8e2f);

    if (!props) {
        clickMarker.bindPopup("Kein Rasterwert gefunden (evtl. auerhalb der AOI).").openPopup();
        return;
    }

    var score = props.energy_suitability;
    var dSub = props.dist_substation_m;
    var dLine = props.dist_line_m;

    var html = "<b>Auswertung am Klickpunkt</b><br>" +
               "Suitability: " + score.toFixed(3) + "<br>" +
               "Distanz Substation: " + Math.round(dSub) + " m<br>" +
               "Distanz Leitung: " + Math.round(dLine) + " m";

    clickMarker.bindPopup(html).openPopup();
});
